  // });
  // setCourses(arr);

// console.log(courses.USD)

// for(let info of courses){
//   console.log('xnj nj' + info)
// }

  return (
    <>
      <Header />
      <main className="main">
        <Courses courses={courses}/>
      </main>
      <Footer />
    </>
  );
}

export default App;
